import React from "react";
import { Routes, Route, BrowserRouter, Navigate} from "react-router-dom";
import UserRedux from "../ParentChild/UserComponent/UserRedux";
// import Users from "../ParentChild/Users";
// import AddDataUser from
// import Home from '../home'
// import Logins from '../Login/Login'
// import Calculator from '../LatihanKomponen/FunctionalComponent'
// import ParentComponent from '../ParentChild/ParentComponent'


const MyRoutes = () => {

    return (
          <BrowserRouter>
          <div>
            <Routes>
            <Route path="/login" element={<Logins/>} />
            {/* <Route path="/home" element={<Home/>} /> */}
            <Route path="/calculator" element={<PrivateRoute><Calculator/></PrivateRoute> } />
            <Route path="/parentchild" element={<PrivateRoute><ParentComponent/></PrivateRoute>} />
            <Route path="/Users" element={<PrivateRoute><UserRedux/></PrivateRoute>} />
          </Routes>
          </div>
          </BrowserRouter>
        
      )

}
const PrivateRoute = (props) => {
  const token = localStorage.getItem('token');

  console.log(token)
  if(!token) return <Navigate to="/login" />
  return props.children
}
export default MyRoutes
